import React from 'react'

const App = () => {
  const img = 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTQd_7qIjTaVBFGH_wbX-CmV8WJjPCYIHhpwukPk3vq0A&s'
  const link = "https://www.google.com/url?sa=i&url=https%3A%2F%2Fmedium.com%2F%40armanansari04.edugaon%2Fwhat-is-react-js-26a80bfb39c1&psig=AOvVaw09sbtXsUK8Y15zcNZCs-S7&ust=1713806932782000&source=images&cd=vfe&opi=89978449&ved=0CBQQjhxqFwoTCJDDy73q04UDFQAAAAAdAAAAABAE"
  return (
    <>
  <h1>hello</h1>
  <img src={img} alt="" />
  <a href= {link}>Click Here</a>
    </>
  )
}

export default App
